import React, {Component} from 'react';
import stylesheet from './styles.js'

export default class Home extends React.Component {
	constructor(props) {
		super(props);
	}
	render() {
		return (
		<h1 style={stylesheet.main}> Welcome to Star Coder</h1>
	);
	}

}
